import './App.css';

import 'bootstrap/dist/css/bootstrap.min.css';
import { Container} from 'react-bootstrap';

import NavBar from './Components/NavBar/NavBar';
import Main from './Components/Main/Main';
import Acccordion from './Components/Accordion/Accordion';
import Catalog from './Components/Catalog/Catalog';
import ArrayForCatalog from './Components/ArrayForCatalog/ArrayForCatalog';



function App() {
  return (
    <Container fluid>
      <NavBar></NavBar>
      <Main></Main>
      <Acccordion></Acccordion>
      <Catalog></Catalog>
      <ArrayForCatalog></ArrayForCatalog>
    </Container>
  );
}

export default App;
